アロマの定番！ティーライトキャンドル
<div align='center'><IMG src=https://image.rakuten.co.jp/dietshop/cabinet/kihon1/net-3055-1.gif><BR><BR><IMG src=https://image.rakuten.co.jp/dietshop/cabinet/kihon1/net-3055-2.gif><BR><BR></div>◇特徴◇<br>・パームオイル100% のナチュラルキャンドル<br>・ススが出ない…<br>・燭台を汚しません。<br>・低温燃焼…<br><br>石油系より燃焼温度が低いのでアロマオイルに最適。<br>クリアカップ…アルミカップに比べ手を切る心配がなく安心してご使用できます。<br>アロマポットや茶香炉に最適の、定番中の定番キャンドル。<br>小さいながらも燃焼時間が長く、小さめの安定した炎が最後まで続くきます。<br><br>オイルウォーマー用予備としてどうぞ。<br>炎が小さいため、急な加熱の弱いガラス燭台やアロマポットなどに適しています。<br><br>燃焼の際、ティンカップの中でロウが液化し、最後まで無駄無く使い切るので経済的。<br>火を消した後、ロウが固まるのを待って動かせば燭台を汚す事は有りません。<br><br>パラフィンと比較し、炎は小さめで、やわらかくマイルドな灯り、キャンドルの炎を消した後の嫌なにおいが残りません。<br>香りを楽しむアロマポット（オイルウォーマー）や、お食事の際のテーブルトップに、そしてまたご飲食店様には特に最適です。<br>サイズ・容量<br>【商品サイズ】直径3.8×高さ1.9cm<br>【重量】約18g<br>【材質】パームオイル100％<br>カップ：ポリカーボネイト樹脂<br>【燃焼時間】約4時間<br>【原産国】中国製<br>【注意事項】※消火の際には若干の煙が出ることもあります<br><br>通常1週間ほどでお届けです<br>人気商品のため、欠品の場合、お時間をいただいたり、完売となることもございます。ご了承くださいませ。<br>広告文責：株式会社ノースウェブ　Tel 0144-52-0018<br><div id="migi-obi">

